import React from "react";

export default function User(props) {
  return (
    <div>
      <ul>
        <li>ad : {props.name}</li>
        <li>departmant: {props.department}</li>
        <li>maaş: {props.salary}</li>
      </ul>

      {/* <form>
        <input type="text"/>
        <button>Gönder</button>
      </form> */}
    </div>
  );
}
